const ROMS = {
    hotbit: base64ToUInt8Array(""),
};
export function base64ToUInt8Array(base64String) {
    // Decode the base64 string
    let binaryString = atob(base64String);
    // Create a UInt8Array of the same length as the decoded binary string
    let uint8Array = new Uint8Array(binaryString.length);
    // Iterate through the binary string and fill the UInt8Array with character codes
    for (let i = 0; i < binaryString.length; i++) {
        uint8Array[i] = binaryString.charCodeAt(i);
    }
    return uint8Array;
}
export default ROMS;
